DELIMITER $$
CREATE TRIGGER `set_pencairan_yg_lalu` BEFORE INSERT ON `tbl_rp_spp_detail` FOR EACH ROW BEGIN
SET 
NEW.pencairan_yg_lalu = (
    select sum(permintaan_sekarang) 
    from tbl_rp_spp_detail 
    where id_rabdes_anggaran = NEW.id_rabdes_anggaran
);
IF new.pencairan_yg_lalu is null THEN
set new.pencairan_yg_lalu = (0);
END IF;

SET 
new.sisa_dana = (NEW.pagu_anggaran - NEW.permintaan_sekarang - NEW.pencairan_yg_lalu);
SET
new.jumlah_saat_ini = (NEW.pencairan_yg_lalu + NEW.permintaan_sekarang);
END
$$
DELIMITER ;

